import React, { Component } from 'react'

export default class Shops extends Component {
    render() {
        return (
            <div>
                {
                    this.props.shops.map((shop) => (
                    <TaggedContentCard
                    href = 'https://github.com/nukeop'
                    thumbnail = {shop.image}
                    title = {shop.name}
                    description = {shop.description}
                    tags = {shop.category}
                  />
                ))   
                }
            </div>
        )
    }
}
